import "./app.css";
import axios from "axios";

function App() {
  var config = {
    method: "get",
    url: "https://www.googleapis.com/youtube/v3/videos?part=snippet&chart=mostPopular&maxResults=26&key=AIzaSyBW5lajHHzU0DJjkuEcY3miO7Ztj-uavDI",
    headers: {},
  };

  axios(config)
    .then(function (response) {
      console.log(JSON.stringify(response.data));
    })
    .catch(function (error) {
      console.log(error);
    });

  return <div>start react practice</div>;
}

export default App;
